INSERT INTO `abas_questions` VALUES (1,1,'ﻳﻨﻈﺮ إﻟﻰ وﺟﻮه اﻵﺧﺮﻳﻦ ﻋﻨﺪﻣﺎ ﻳﺘﺤﺪﺛﻮن إﻟﻴﻪ','Looks at other people’s faces when they are talking to him or her','2023-08-23 08:07:40','2023-09-03 13:57:49',1),(2,1,'ﻳﻨﻈﺮ ﻷﻋﻠﻰ أو ﻳﺒﺘﺴﻢ ﻋﻨﺪﻣﺎ ﻳﻘﻮل أﺣﺪﻫﻢ إﺳﻤﻪ','Looks up or smiles when someone says his or her name','2023-08-23 08:08:17','2023-09-03 13:57:49',2),(3,1,'ﻳﻀﺤﻚ ﻋﻨﺪﻣﺎ ﻳﻀﺤﻚ أﺣﺪ اﻟﻮاﻟﺪﻳﻦ أو أي ﺷﺨﺺ آﺧﺮ.','Laughs when a parent or other person laughs','2023-08-23 08:10:27','2023-09-03 13:57:49',3),(4,1,'ﻳﺮﻓﻊ اﻟﺼﻮت ﻭﻳﺨﻔﻀﻪ ﻟﻠﺘﻌﺒﻴﺮ ﻋﻦ ﻣﺸﺎﻋﺮ ﺃو اﺣﺘﻴﺎﺟﺎت ﻣﺨﺘﻠﻔﺔ.','Raises and lowers voice to express different feelings or needs','2023-08-23 08:10:41','2023-09-03 13:57:49',4),(5,1,'ﻳﻘﻮل أﺳﻤﺎء أﺷﺨﺎص ﺁﺧﺮﻳﻦ (ﻋﻠﻰ ﺳﺒﻴﻞ ﺍﻟﻤﺜﺎل ، \"ﻣﺎﻣﺎ\" أو \"ﺑﺎﺑﺎ\" أو أﺳﻤﺎء اﻷﺻﺪﻗﺎء.)','Says the names of other people (for example, “Mama,” “Daddy,” or names  of friends','2023-08-23 08:11:12','2023-09-03 13:57:49',5),(6,1,'ﻳﺘﺒﻊ أواﻣﺮ بسيطة (ﻋﻠﻰ ﺳﺒﻴﻞ اﻟﻤﺜﺎل ، \"ﻻ\" أو \"ﺗﻌﺎل ﻫﻨﺎ)','Follows simple commands (for example, “No” or “Come here”)','2023-08-23 08:12:09','2023-09-03 13:57:49',6),(7,1,'ﻳﺴﺘﺨﺪم ﻛﻠﻤﺔ واﺣﺪة أو أﻛﺜﺮ ﻟﻠﺤﺼﻮل ﻋﻠﻰ ﺷﻲء ﻳﺮﻳﺪه ، ﺣﺘﻰ ﻟﻮ ﻟﻢ ﻳﺘﻢ ﻧﻄﻖ اﻟﻜﻠﻤﺔ  ﺑﺸﻜﻞ ﺻﺤﻴﺢ أو ﻟﻢ\nﻳﺘﻢﻧﻄﻘﻬﺎ ﺑﺸﻜﻞ ﺟﻴﺪ.','Follows simple commands (for example, “No” or “Come here”)','2023-08-23 08:12:46','2023-09-03 13:57:49',7),(8,1,'ﻳﻬﺰ رأﺳﻪ أو ﻳﻘﻮل \"ﻧﻌﻢ\" أو \"ﻻ\" ردا ﻋﻠﻰ ﺳﺆال ﺑﺴﻴﻂ (ﻋﻠﻰ ﺳﺒﻴﻞ اﻟﻤﺜﺎل ، \"ﻫﻞ ﺗﺮﻳﺪ ﺷﻴئا             \nﺗﺸﺮﺑﻪ)','Shakes head or says “Yes” or “No” in response to a simple question (for example, “Do you want something to drink?”)','2023-08-23 08:13:14','2023-09-03 13:57:49',8),(9,1,'ﻳﺸﻴﺮ إﻟﻰ الأشياء الأساسية ﻓﻲ غرفة ﻋﻨﺪﻣﺎ ﻳﻄُﻠﺐ منه ذﻟﻚ (ﻋﻠﻰ ﺳﺒﻴﻞ اﻟﻤﺜﺎل ، \"أشر ﻟﻲ\nاﻟﺘﻠﻔﺰﻳﻮن)','Points to common items in a room when asked (for example, “Show me the TV”)','2023-08-23 08:55:37','2023-09-03 13:57:49',9),(10,1,'ﻳﻜﺮر اﻟﻜﻠﻤﺎت اﻟﺘﻲ ﻳﻘﻮﻟﻬﺎ اﻵﺧﺮون )ﻋﻠﻰ ﺳﺒﻴﻞ اﻟﻤﺜﺎل ، ﻳﻘﻮل \"ﻃﻔﻞ\" ﻋﻨﺪﻣﺎ ﻳﻘﻮل ﺷﺨﺺ ﺑﺎﻟﻎ \"ﻃﻔﻞ','Repeats words others say (for example, says “baby” when an adult says  “baby”)','2023-08-23 08:55:37','2023-09-03 13:57:49',10),(11,1,'ﻳﻘﻮل ﻋﺒﺎرات ﺗﺤﺘﻮي ﻋﻠﻰ ﻛﻠﻤﺘﻴﻦ ﻋﻠﻰ اﻷﻗﻞ (ﻋﻠﻰ ﺳﺒﻴﻞ اﻟﻤﺜﺎل ، \"ﻛﺘﺎﺑﻲ)','Says phrases with at least two words (for example, “My book”)','2023-08-23 10:03:25','2023-09-03 13:57:49',11),(12,1,'ﻳﻘﻮل اﺳﻢ اﻟﺸﻲء ﺑﻮﺿﻮح ﻛﺎف ٍ ﺑﺤﻴﺚ ﻳﺘﻌﺮف ﻋﻠﻴﻪ  اﻵﺧﺮون(ﻋﻠﻰ ﺳﺒﻴﻞ اﻟﻤﺜﺎل ، \"ﻛﺮة\" ، \"\nﻛﻠﺐ\" ، \"ﻛﻮب)','Says the name of an object clearly enough that others recognize it (for  example, “ball,” “dog,” “cup”).','2023-08-23 10:08:36','2023-09-03 13:57:49',12),(13,1,'ينصت ﻟﻤﺪة دﻗﻴﻘﺔ واﺣﺪة ﻋﻠﻰ اﻷﻗﻞ ﻋﻨﺪﻣﺎ ﻳﺘﺤﺪث اﻟﻨﺎس','Listens closely for at least 1 minute when people talk','2023-08-23 10:09:57','2023-09-03 13:57:49',13),(14,1,'يرتدي معطفًا أو سترة عندما يكون الجو باردًا.','Puts on a coat or sweater when cold.','2023-08-23 10:22:04','2023-09-07 06:43:00',14),(15,1,'ﻳﺘﺒﻊ ﺗﻮﺟﻴﻬﺎت ﺑﺴﻴﻄﺔ ﻣﻦ ﺧﻄﻮة واﺣﺪة ﺗﺘﻀﻤﻦ \"ﻓﻮق\" أو ﺗﺤﺖ (ﻋﻠﻰ ﺳﺒﻴﻞ ﺍﻟﻤﺜﺎل ، \"\nارفع يديك للأعلى )','Follows simple, one-step directions that include “over” or “under” (for   example, “Put your hands over your head”).','2023-08-23 10:24:11','2023-09-03 13:57:49',15),(16,1,'ﻳﻤﺘﻨﻊ ﻋﻦ ﺗﻜﺮار الكلام ﻣﺮارا  وﺗﻜﺮارا','Refrains from repeating what he or she says over and over again','2023-08-23 10:25:35','2023-09-03 13:57:49',16),(17,1,'ﻳﺴﻤﻲ 20 أو أﻛﺜﺮ ﻣﻦ اﻷﺷﻴﺎء اﻟﻤﺄﻟﻮﻓﺔ','Names 20 or more familiar objects','2023-08-23 10:26:28','2023-09-03 13:57:49',17),(18,1,'ﻳﻐﻨﻲ اغنية كاملة أو ﺟﺰء ﻣﻨﻬﺎ','Sings all or part of the words to songs','2023-08-23 10:27:10','2023-09-03 13:57:49',18),(19,1,'ﻳﻘﻮم ﺑﻌﻤﻞ ﺻﻴﻎ اﻟﺠﻤﻊ (ﻋﻠﻰ ﺳﺒﻴﻞ اﻟﻤﺜﺎل ، \"أﺣﺬﻳﺔ\" ، \"ﺟﻮارب\" ،    \nﻛﻼب.)','Makes plurals of words by adding an -s (for example, “shoes,” “socks, “dogs”)','2023-08-23 10:28:51','2023-09-03 13:57:49',19),(20,1,'يستخدم جملة  مكونة من اسم وفعل','Uses sentences with a noun and verb','2023-08-23 10:31:02','2023-09-03 13:57:49',20),(21,1,'ﻳﺨﺒﺮ اﻟﻮاﻟﺪ أو اﻷﺻﺪﻗﺎءأو اﻵﺧﺮﻳﻦ ﻋﻦ أﻧﺸﻄﺘﻪ اﻟﻤﻔﻀﻠﺔ','Tells parent, friends, or others about his or her favorite activities','2023-08-23 10:32:56','2023-09-03 13:57:49',21),(22,1,'ﻳﻄﺮح أسئلة ﻣﺜﻞ \"ﻫﻞ ﺗﻠﻌﺐ ﻣﻌﻲ..