3-09-17 06:15:34','2023-09-17 06:15:34',15),(862,38,'يفرض مطالب معقولة على الأصدقاء (على سبيل المثال، لا ينزعج عندما يلعب صديق مع صديق آخر).','Places reasonable demands on friends (for example, does not become upset when a friend plays with another friend).','2023-09-17 06:16:09','2023-09-17 06:16:09',16),(863,38,'ينظر إليه على أنه \"مناسب\" من قبل الآخرين في نفس العمر','Is viewed as “fitting in” by others the same age','2023-09-17 06:16:36','2023-09-17 06:16:36',17),(864,38,'يمتنع عن قول أو فعل أشياء قد تحرج أو تؤذي الآخرين.','Refrains from saying or doing things that might embarrass or hurt others.','2023-09-17 06:17:05','2023-09-17 06:17:05',18),(865,38,'يختار الأصدقاء بشكل حكيم و جيد','Shows good judgment in selecting friends.','2023-09-17 06:18:08','2023-09-17 06:18:08',19),(866,38,'يهنئ الآخرين عندما يحدث لهم شيء جيد.','Congratulates others when something good happens to them.','2023-09-17 06:18:26','2023-09-17 06:18:26',20),(867,38,'يدرك عندما يقوم شخص ما بتقديم طلب غير معقول.','Recognizes when someone is making an unreasonable request.','2023-09-17 06:19:40','2023-09-17 06:19:40',21),(868,38,'يمدح الآخرين على الأعمال أو السلوك الجيد (على سبيل المثال، الصدق أو اللطف).','Compliments others for good deeds or behavior (for example, honesty or kindness).','2023-09-17 06:20:15','2023-09-17 06:20:15',22),(869,39,'يتصرف بأمان في العمل حتى لا يتعرض أحد للأذى.','Behaves safely at work so that no one will be harmed.','2023-09-17 06:25:44','2023-09-17 06:25:44',1),(870,39,'يحترم ملكية وحقوق العمال الآخرين.','Respects the property and rights of other workers.','2023-09-17 06:26:10','2023-09-17 06:26:10',2),(871,39,'يظهر موقفا إيجابيا تجاه الوظيفة.','Shows a positive attitude toward job.','2023-09-17 06:28:37','2023-09-17 06:28:37',3),(872,39,'يهتم بشكل صحيح بمستلزمات ومعدات العمل','Cares properly for work supplies and equipment','2023-09-17 06:29:07','2023-10-23 10:17:34',4),(873,39,'يساعد العاملين الآخرين في عملهم دون التدخل في عمله.','Helps other workers with their work without interfering with his or her own work.','2023-09-17 06:30:02','2023-09-17 06:30:02',5),(874,39,'يتبع تعليمات المشرف عند استكمال المهام أو الأنشطة','Follows supervisor’s instructions when completing tasks or activities','2023-09-17 06:30:43','2023-09-17 06:30:43',6),(875,39,'يكمل مهام العمل ضمن الوقت المطلوب.','Completes work assignments within required time limits.','2023-09-17 06:31:19','2023-09-17 06:31:19',7),(876,39,'يطلب المساعدة من المشرف، حسب الحاجة، عند ظهور مشاكل أو أسئلة متعلقة بالعمل.','Seeks help from supervisor, as needed, when work-related problems or questions arise.','2023-09-17 06:31:59','2023-09-17 06:31:59',8),(877,39,'يرجاع الأدوات والعناصر الأخرى المتعلقة بالعمل إلى مكانها الصحيح بعد استخدامها.','Returns tools and other work-related items to their proper place after   using them.','2023-09-17 06:32:43','2023-09-17 06:32:43',9),(878,39,'يرفض عندما يشجعه زميله في العمل على القيام بعمل رديء أو غير آمن.','Refuses when a coworker encourages him or her to do shoddy or unsafe  work.','2023-09-17 06:34:05','2023-09-17 06:34:05',10),(879,39,'يتبع جدول العمل اليومي دون تذكير من المشرف.','Follows daily work schedule without reminders from supervisor.','2023-09-17 06:34:25','2023-09-17 06:34:25',11),(880,39,'يعمل بهدوء دون إزعاج زملاء العمل.','Works quietly, without disturbing coworkers.','2023-09-17 06:34:49','2023-09-17 06:34:49',12),(881,39,'يسأل عن التوجيهات، حسب الحاجة، قبل بدء مهام العمل.','Asks for directions, as needed, before beginning work tasks.','2023-09-17 06:35:34','2023-09-17 06:35:34',13),(882,39,'يتحقق من العمل  لتحديد إذا كان هناك حاجة إلى تحسينات.','Checks own work to determine if improvements are needed.','2023-09-17 06:36:17','2023-09-17 06:36:17',14),(883,39,'التحقق من الراتب للتأكد من حصوله على المبلغ المناسب.','Verifies wages to ensure that he or she is receiving the proper amount.','2023-09-17 06:37:43','2023-09-17 06:37:43',15),(884,39,'العمل بشكل أسرع حسب الحاجة (على سبيل المثال، الالتزام بالجدول الزمني أو الالتزام بالموعد النهائي لتسليم العمل)','Works faster on the job as needed (for example, to stay on schedule or meet a deadline)','2023-09-17 06:38:21','2023-09-17 06:38:21',16),(885,39,'تقديم اقتراحات للمشرفين (على سبيل المثال، كيفية الحصول على مكان عمل أكثر أمانًا وإنتاجية).','Makes suggestions to supervisors (for example, how to have a safer or  more productive workplace).','2023-09-17 06:39:01','2023-09-17 06:39:01',17),(886,39,'يأخذ دروسًا أو يحصل على تدريب لتحسين مهارات العمل.','Takes classes or obtains training to improve work skills.','2023-09-17 06:39:26','2023-09-17 06:39:26',18),(887,39,'يدرب ويشرف على الآخرين في مكان العمل.','Trains and supervises others in the workplace.','2023-09-17 06:39:48','2023-09-17 06:39:48',19),(888,20,'يهتم بشكل صحيح بمستلزمات ومعدات العمل.','Cares properly for work supplies and equipment.','2023-10-23 10:55:36','2023-10-23 10:55:36',10);
