INSERT INTO `casd_questions` VALUES (1,1,'العزلة الاجتماعية.',NULL,'<ul>\n<li>منسحب، منعزل، يتجنب التواصل مع الآخرين، أو يفضل اللعب لوحده أكثر من اللعب مع الأقران</li>\n<li>يمارس اللعب المتوازي (جنباً إلى جنب، لكن بدون التفاعل مع الأقران)</li>\n<li>يعاني من صعوبات في تكوين الصداقات</li>\n</ul>',NULL,1,'2023-09-04 18:23:08','2023-09-20 07:15:58'),(2,1,'محدودية التفاعل التبادلي',NULL,'<ul>\n<li>محدودية في الابتسامات الاجتماعية أو التواصل البصري: (ينظر بعيداً، ينظر خلال الأشخاص، ينظر إلى فم الشخص المتحدث، يحتاج إلى التشجيع كي يقوم بعملية التواصل البصري، غير قادر على القيام بالتواصل البصري أثناء عملية المحادثة)</li>\n<li>محدودية في العرض والمشاركة (مثل: غير قادر على عرض اللعبة على البالغين، لا يحب الظهور، لا يشارك خبراته أو إنجازاته مع الآخرين)</li>\n<li>لديه جمود عالي أثناء لعبه مع الأقران (يقوم بفرض اللعب طبقاً لقواعده واهتماماته التي تتناسب مع ميوله الشاذة والمتكررة)</li>\n<li>يستمتع باللعب الجسدي واللعب الحسي مع الآخرين (مثل: الدغدغة، المطاردة) لكن تفاعله التبادلي الاجتماعي محدود (مثل: لا يقوم بالمشاركة في الألعاب الاجتماعية أو الألعاب التي تتطلب لعب الأدوار أو الحديث)</li>\n</ul>',NULL,2,'2023-09-04 18:23:08','2023-09-20 07:52:48'),(3,1,'الانشغال بالذات',NULL,'<ul><li>مستغرق بالانشغال بذاته أو بعالمه الخاص (مثل: الانشغال بسلوكات الاستثارة الذاتية، يتحدث إلى ذاته، أو منشغل جداً بخيالات عن الأشياء كالأفلام أو مسلسلات الكرتون)</li><li>غير مدرك وغير واعي لحضور الاخرين أو لا يستجيب للمبادرات الاجتماعية من قبل الآخرين</li></ul>',NULL,3,'2023-09-04 18:23:08','2023-09-05 09:20:30'),(4,1,'السلوك الاجتماعي العشوائي غير المناسب للموقف',NULL,'<ul><li>يقوم بالحديث والعناق للغرباء بطريقة غير مناسبة</li><li>ينتهك المساحات الخاصة للآخرين (يقترب كثيراً أو يلمس الآخرين)</li><li>ليس لديه قلق من الغرباء أو الانفصال عن الآخرين عندما يكون صغيراً (لا يكترث لوجود الغرباء أو لا يشعر بالانزعاج عندما ينفصل عن الوالدين)</li><li>يستخدم سلوكات وملاحظات غير مناسبة اجتماعيا أو غير مواكبة لمشاعر الآخرين (مثل: يقوم بوضع إصبعه في أنفه أمام العامة، يقوم بطرح أسئلة شخصية)</li></ul>',NULL,4,'2023-09-04 18:23:08','2023-09-05 09:21:57'),(5,1,'مشكلات في المهارات الاجتماعية',NULL,'<ul><li>غير قادر على المبادرة أو المحافظة على التفاعل مع الأقران بشكل مناسب على الرغم بأنه يتفاعل بشكل جيد مع البالغين</li><li>ضعف الاستدلال الاجتماعي (صعوبة في إدراك الإشارات والتلميحات والتعليقات الاجتماعية، تعبيرات الوجه، لغة الجسد)</li><li>يرغب بتكوين صداقات، لكنه غير قادر على معرفة الطريقة لتكوين أصدقاء</li></ul>',NULL,5,'2023-09-04 18:23:08','2023-09-05 09:22:08'),(6,2,'مجال غير اعتيادي \"ضحل\" من الاهتمام واللعب السلوكي',NULL,'<ul><li>لديه سلوك قهري بالتعلق في الأشياء، يتعلق بصورة كبيرة في الأشياء: كفيلم محدد أو برنامج تلفزيوني: (يقوم بإعادة التمثيل أو يشاهد نفس الفيلم بشكل مكرر)، ألعاب الكمبيوتر، الحروف، الأشكال، الأرقام، العد، الأشياء والمواضيع (مثل: القطارات، الديناصورات، لعبة سباق السيارات، الخرائط، الطائرات، الأدوات الكهربائية، يوغي يو، الشخصيات الكرتونية، وغيرها)</li><li>تعلق غير طبيعي وتمسك واحتفاظ بالأشياء (مثل: الأشياء الصغيرة، السلاسل</li><></ul>',NULL,6,'2023-09-04 18:23:08','2023-09-05 09:22:25'),(7,2,'اللعب النمطي والتكراري',NULL,'<ul><li>لعب تكراري (يرتب الأشياء أو الألعاب، أو يفرزها، أو يدورها، أو يرميها بشكل مبالغ فيه؛ يقوم بفتح الأشياء وإغلاقها بشكل متكرر، يلعب بنفس الألعاب بدون تنويع؛ يرسم نفس الصورة بشكل متكرر</li><li>لديه ضعف في اللعب التخيلي المتنوع.</li><li>انشغالات غير طبيعية بأجزاء الأشياء (مثل: القيام بتدوير عجلات اللعبة بشكل متكرر)</li></ul>',NULL,7,'2023-09-04 18:23:08','2023-09-05 09:22:29'),(8,2,'الانزعاج من التغيير',NULL,'<ul><li>ينزعج من التغيير (مثل: عند التغيير في الروتين أو الجدول اليومي، عندما يأخذ الوالدان طريقاً مختلفاً عن الطريق المؤدي إلى المنزل أو إلى المدرسة، عند تحريك أثاث البيت أو ألعابه، التغيرات الموسمية للملابس</li><li>صعوبات في الانتقال (مثل: الانتقال من نشاط إلى نشاط آخر)</li><li>حاجة ملحة لإنهاء ما بدأ/ بدأت به</li><li>أنماط وطقوس خاصة (مثل: يشرب من كأس محدد، يرتدي ملابس محددة، يصر على أن الطعام يجب أن يكون مرتب بطريقة محددة في الصحن</li><li>يصر على أن تكون الأشياء في موقع محدد أو طريقة معينة، (مثل: الباب يجب أن يكون مغلقاً، سحاب المعطف، وغيرها)</li><li>يصر على القيام بالأشياء بنفس الطريقة في كل مرة</li><li>مفرط في الدقة وغير مرن، ينزعج إذا قام أحدهم \"بكسر القاعدة\" جامد وصارم في تفكيره</li></ul>',NULL,8,'2023-09-04 18:23:08','2023-09-05 09:22:34'),(9,2,'النمطية (حركات نمطية تكرارية كالرفرفة باليدين عندما يكون متحمس، مشي على رؤوس الأصابع، اهتزاز الجسم، هز الرأس، شد الجسم عند الاستيقاظ، صرير الأسنان، طحن الأسنان عند الاستيقاظ، تحريك الأصابع، تكشير الوجه، يركض إلى الأمام والخلف بشكل متكرر،اللف والدوران، الجري غير الهادف، يلعب في لعابه، نتف الجلد)',NULL,NULL,NULL,9,'2023-09-04 18:23:08','2023-09-05 13:57:31'),(10,3,'حاجة غير طبيعية ومفرطة لحب: الدوران، الدغدغة، القفز ، الهز ، الأرجحة، التسلق، الوثب',NULL,NULL,NULL,10,'2023-09-04 18:23:08','2023-09-05 09:23:49'),(11,3,'لا يستجيب في الوقت المحدد للتعليمات اللفظية (مثل: لا يقوم برد فعل عندما يتم المناداة على اسمه أو التحدث إليه أو يجيب الأسئلة التي يسمعها)',NULL,NULL,NULL,11,'2023-09-04 18:23:08','2023-09-05 09:23:54'),(12,3,'الحساسية المفرطة',NULL,'<ul><li>حساسية مفرطة غير اعتيادية لبعض الأصوات (مثل: ينزعج أو يقوم بتغطية أذنيه كاستجابة للصوت العالي، المحركات، المكنسة الكهربائي، مجفف الشعر، بكاء الأطفال، صفارات الإنذار، التصفيق، المنبه، سيفون الحمام، غناء الناس)</li><li>حساسية مفرطة غير عادية للروائح، الأضواء أو الحرارة</li></ul>',NULL,12,'2023-09-04 18:23:08','2023-09-05 09:23:59'),(13,3,'ينزعج من التجمعات والازدحامات (لا يرتاح أو يشعر بالقلق في التجمعات الكبيرة، المسارح، كافتيريا، الحفلات)',NULL,NULL,NULL,13,'2023-09-04 18:23:08','2023-09-05 09:24:08'),(14,3,'ينبهر للغاية بالدوران أو الحركات التكرارية (مثل: المراوح الدوارة، عجلة الحظ، المياه الجارية)، الأنماط الخطية (مثل: مؤشرات تلفزيونية،ستائر النوافذ)، التفاصيل الدقيقة، الأضواء الأسطح المشعة',NULL,NULL,NULL,14,'2023-09-04 18:23:08','2023-09-05 09:24:13'),(15,3,'التفحص الحسي غير العادي',NULL,'<ul><li>يشم بإفراط، يتذوق بإفراط، يمضغ بإفراط، يلعق بإفراط، أو يفرك الأشياء الجامدة على الأسطح</li><li>يتفحص الأشياء بصريا بشكل متكرر أو يحرك إصبعه بالقرب من عينيه</li><li>يضع أذنه على الأشياء التي تهتز أو تدمدم أو يقوم بضغط الأشياء نحو الوجه لدرجة غير اعتيادية</li></ul>',NULL,15,'2023-09-04 18:23:08','2023-09-05 09:24:22'),(16,3,'الدفاعية اللمسية أو الكراهية المفرطة لـ',NULL,'<ul><li>إذا تم لمسه أو حضنه</li><li>ملامسة أشياء محددة  أو أن تتسخ يده أو أن تكون لزجه</li><li>وجود المياه عليه أو على ملابسه</li><li>أن يقوم بغسل وجهه، تنظيف أسنانه، تمشيط شعره، أو قص أظافره</li><li>أن يمشي حافي القدمين</li><li>أن تكون الملابس ضيقة، تشابه في الملابس، خامة محددة من الملابس</li></ul>',NULL,16,'2023-09-04 18:23:08','2023-09-05 09:24:29'),(17,3,'قدرة عالية على تحمل الألم (مثل: لا يبكي عندما يتألم أو لا يستجيب بشكل عادي لمحفزات الألم)',NULL,NULL,NULL,17,'2023-09-04 18:23:08','2023-09-05 09:24:42'),(18,3,'خلل في النوم (مثل: صعوبة الاستغراق في النوم، استيقاظ أثناء الليل، استيقاظ مبكر في الصباح)',NULL,NULL,NULL,18,'2023-09-04 18:23:08','2023-09-05 09:24:49'),(19,3,'مشاكل الطعام',NULL,'<ul><li>انتقائي في الأكل، ولديه محدودية في الأطعمة المفضلة، أو يصر على تناول قلة من الأطعمة</li><li>حساسية مفرطة للأكل المخلوط (مثل: اللحم في الطعام)</li><li>يبقي الطعام في فمه بدون بلع</li><li>يأكل المواد غير صالحة للأكل</li><li>أنماط خاصة للأكل (مثل: يأكل نوع واحد أو علامة تجارية محددة من الطعام، لون، شكل طعام</li></ul>',NULL,19,'2023-09-04 18:23:08','2023-09-05 09:24:57'),(20,4,'نكوص لغوي أو تأخر بمقدار سنة إلى سنتين من العمر (مثل: يتحدث كلمات بسيطة في عمر السنة ولكن بعد ذلك يفقد النمو الطبيعي للغة)',NULL,NULL,NULL,20,'2023-09-04 18:23:08','2023-09-05 09:25:29'),(21,4,'المهارات البصرية الحركية (مثل: تجميع لعبة التركيب، بناء المجسمات، تشغيل القرص المدمج)، يكون أعلى بكثير من المهارات اللغوية أثناء مرحلة ما قبل المدرسة أو يقوم بالمشي بشكل مبكر أكثر من الحديث',NULL,NULL,NULL,21,'2023-09-04 18:23:08','2023-09-05 09:25:37'),(22,4,'اضطراب في التواصل',NULL,'<ul><li>غياب أو محدودية التواصل بالكلام لكن يتواصل بالإيماءات (مثل: يسحب الشخص البالغ من يده ليوجهه إلى ما يريده، يعطي شيء للشخص البالغ للمساعدة، يحضر كأس للشخص كي يشرب)</li><li>يتواصل لفظياً مع الآخرين فقط عندما يتوتر أو يحتاج شيء ما فقط</li><li>صعوبة في المحادثة اللفظية المتبادلة (البدء بالمحادثة والمحافظة عليها، الاستماع والاستجابة إلى ما يقوله الآخرين)، يتحدث مع الأشخاص، أو محادثات من جهة واحدة بمواضيع مهمة له</li></ul>',NULL,22,'2023-09-04 18:23:08','2023-09-05 09:25:44'),(23,4,'تفوهات أو كلام غير مألوف',NULL,'<ul><li>طبيعة صوت غريبة (مثل: حدة صوت مرتفعة، صوت ذو نغمة واحدة، غياب في التنغيم، وغيرها)</li><li>يصرخ أو يصدر تفوهات مزعجة (مثل: يهمهم أو يدندن، وغيرها)</li><li>تفوهات غير مألوفة مكررة</li><li>ثرثرة غير مألوفة وكأنه يتكلم بلغته الخاصة</li><li>مصاداة (تقليد غير ملائم لما يقوله الآخرين  كأن يعيد السؤال بدلاً من الإجابة عليه)</li><li>كلام متفرق (يقول كلمة أو جملة مرة ونادراً ما يكررها أو لا يكررها أبداً)</li><li>يتقمص أو يقلد بمبالغة أو يقتبس بمبالغة من الأفلام، الكرتون، الدعايات، وغيرها</li><li>يستخدم شبه جمل محفوظة بعيدة عن النص، غير مرتبطة بالسياق</li><li>يقوم باستبدال الضمائر (مثل: يقول \"أنت\" عندما يقصد \"أنا\")</li><li>يفرط في استخدام الكلام الزائد</li><li>كلام أو أفكار غير مألوفة (مثل: يصنع كلمات، كلام لا معنى له، وجهات نظر فريدة)</li></ul>',NULL,23,'2023-09-04 18:23:08','2023-09-05 09:25:51'),(24,4,'قدرات خاصة تعد اعلى من غيرها من القدرات',NULL,'<ul><li>ذاكرة حفظ فريدة من نوعها (مثل: في عمر صغير جداً وبشكل غير مألوف يتعرف على الأرقام، الأحرف، الأشكال، العلامات التجارية، والألوان، يغني أو يهمهم نغمات، يحفظ الطرق التي تسير بها السيارة، يعد الأرقام، يميز الأحرف الأبجدية، يقرأ، يتهجأ، وغيرها)</li><li>مفردات غير مألوفة أو القدرة على حفظ الأفلام، الكتب، أو الحقائق</li><li>قدرة عالية على تقليد الأفلام أو الشخصيات الكرتونية</li><li>مهارات بصرية - حركية مميزة (مثل: في عمر صغير جداً، يركّب الألعاب، يطابق الأشكال، يشغل جهاز الحاسوب، يشغل القرص المدمج، يعرف كيفية عمل الأشياء، يركب قطع المركبات لإنتاج أشكال معقدة) </li><li>لديه موهبة فنية أو موسيقية مميزة</li><li>زيادة وتطور المهارات الحركية لديه مرتفع مع تأخر في التطور لمجالات أخرى (بالمقارنة مع الأطفال المشخصين باضطراب طيف التوحد من ذوي المهارات المرتفعة والذين يواجهون مشاكل في الكتابة أو في التنسيق الحركي).</li></ul>',NULL,24,'2023-09-04 18:23:08','2023-09-05 09:25:56'),(25,5,'رد فعل مفرط، تهيج، إحباط، ضغف القدرة على تحمل الإحباط، مثار، نوبة الغضب، الانهيار، الانفجار ، العنف، سلوكات إيذاء الذات (ينزعج من الأحداث الصغيرة، أو حوادث معظم الأطفال قادرين على تحملها كالتطفل، مقاطعة النشاطات، التقارب، التواجد ضمن حيز مكاني معين، المتطلبات الأدائية، مهارات الكتابة، عندما لا تكون الأشياء كما يريدها الطفل',NULL,NULL,NULL,25,'2023-09-04 18:23:08','2023-09-05 13:57:48'),(26,5,'مزاجي \"نكد\"، متقلب المزاج (السبب في تغير المزاج ربما لا يكون واضحاً دائماً، كأن يقوم بالضحك أو الانزعاج دون سبب واضح)',NULL,NULL,NULL,26,'2023-09-04 18:23:08','2023-09-05 09:26:43'),(27,5,'صعوبة في إظهار أو تفهم المشاعر، لا يعطي ردود فعل عاطفية في بعض المواقف، لديه نقص في التعاطف أو تبادل المشاعر (مثل: لا يستجيب بشكل مناسب أو يشعر بالراحة عندما يؤذى شخص آخر أو يكون الشخص حزيناً)، أو يسيء تفسير مشاعره أو استجابات الآخرين',NULL,NULL,NULL,27,'2023-09-04 18:23:08','2023-09-05 09:26:49'),(28,5,'خوف غير عادي، كالخوف من المصاعد، الدّرَج، الحمام، البالونات، المكانس، الأعاصير',NULL,NULL,NULL,28,'2023-09-04 18:23:08','2023-09-05 09:26:55'),(29,6,'انتباه انتقائي، قادر على التركيز الزائد على النشاطات الأشياء أو المواضيع التي تهمه (مثل: ترتيب الألعاب أو الأشياء بصف واحد، تدوير العجلات، مشاهدة نفس الفيلم، تركيب الأحاجي، بناء المجسمات، أو رسم الصور لفترة طويلة من الوقت)، لكن يكون شارد الذهن، مندفع، متململ في أوقات أخرى.',NULL,NULL,NULL,29,'2023-09-04 18:23:08','2023-09-05 13:57:11'),(30,6,'لديه وعي محدود بالسلامة ولا يعرف الخوف، غير مدرك للخطر (مثل: يتسلق بطريقة غير آمنه، يتجول في المنزل ليلاً، يركض حول نفسه، يذهب إلى الازدحامات المرورية أو تجمعات المياه، يذهب مع الغرباء.',NULL,NULL,NULL,30,'2023-09-04 18:23:08','2023-09-05 09:27:22');
