INSERT INTO `notifications` VALUES (1,'ترحيب','نرحب بكم في مركز بانا للاستشارات والأبحاث والتدريب، حيث يسعدنا أن نرحب بكم في عائلتنا و تقديم أعلى مستويات الخدمة والجودة.\nنحن هنا لخدمتكم ومساعدتكم في تحقيق أهدافكم وطموحاتكم المهنية. يضم فريقنا مجموعة من الخبراء والمحترفين في مختلف المجالات، مستعدين لتقديم الاستشارات والبحوث المتخصصة وبرامج التدريب المبتكرة.',NULL,'announcement','centers',1,'2023-08-17 11:18:08','2023-08-17 11:18:08');
