INSERT INTO `sliders` VALUES (1,NULL,'مقياس لايتر-3 الأدائي العالمي – الصورة العربية، هو اختبار يتم تطبيقه بشكل فردي، وهو مصمم لتقييم الوظائف المعرفية لدى الأطفال والمراهقين والبالغين – من سن 3 سنوات إلى 75 عاماً فما فوق. ويتضمن الاختبار مقاييس الذكاء غير اللفظي في التفكير المرن والتصور، بالإضافة إلى تقييم الذاكرة غير اللفظية والانتباه والتداخل المعرفي. وتعتبر النسخة الثالثة من مقياس اللايتر من أحدث وأهم مقاييس الذكاء في جميع أنحاء العالم.','/sliders/image_1692015767.jpg','2023-05-21 09:58:41','2023-08-14 10:22:48','https://banacenter.com/projects/leiter-global-performance-scale-3rd-edition/'),(2,NULL,'يتميز مقياس لايتر-3 عن غيره من اختبارات الذكاء بتركيزه على الذكاء السائل، وهو مؤشر موثوق يقيس القدرات المعرفية الفطرية للفرد، مما يجعله أكثر دقة وعدلاً، نظرًا لعدم تأثر مستوى الذكاء العام للفرد بشكل كبير بالتجربة التعليمية والاجتماعية والعائلية. ويتضمن هذا المقياس العديد من المهارات المهمة مثل الشكل والأرضية، وتكملة الأشكال، والتصنيف والتماثل، والأوامر المتسلسلة، بالإضافة إلى الأنماط البصرية الاختيارية','/sliders/image_1692015772.jpg','2023-07-29 10:47:11','2023-08-14 10:22:53','https://banacenter.com/coursess/'),(3,NULL,'اختبارات الذكاء ودورها في الكشف عن مشكلات التعليم','/sliders/image_1692015777.jpg','2023-07-29 10:48:09','2023-08-14 10:22:58','https://banacenter.com/psyctest/'),(4,NULL,'مقيـــاس لايتـــر - 3 الأدائـــي العالمي للذكاء النســـخة الثالثـــة – الصورة العربيـــة يعتبر من أفضـــل مقاييس الذكاء الادائية(غيـــر لفظي) على مستوى العالم ، ويتميز هذا المقياس بتحرره من العوامل الثقافية .\nتعرف معنا على استخدامات هذا المقياس','/sliders/image_1692015814.jpg','2023-07-29 10:50:30','2023-08-14 10:23:35','https://web.facebook.com/banacenterRCT/videos/765363075047455');
